const User = ({ user }) => {
  return (
    <div>
      <hr />
      <p>{`Full Name: ${user.name.first} ${user.name.last}`}</p>
      <p>{`Username: ${user.login.username}`}</p>
      <img style="float:;" src={`Thumbnail: ${user.picture.thumbnail}`} alt="1"></img>
    </div>
  )
}

export default User
